        Allcode.hasMany (models.Booking, {foreignKey: 'timeType', as: 'timeTypeDataPatient'})
        
      }
  };
  Allcode.init({ 
    keyMap: DataTypes.STRING,
    type: DataTypes.STRING,
    valueEn: DataTypes.STRING,
    valueVn: DataTypes.STRING,
    
  }, {
    sequelize,
    modelName: 'Allcode',
  });
  return Allcode;
};

