sourcesContent:
require ('dotenv').config(); 
import nodemailer from 'nodemailer';

let sendSimpleEmail = async ( dataSend ) => { 
 

      // create reusable transporter object using the default SMTP transport
      let transporter = nodemailer.createTransport({
        host: "smtp.gmail.com",
        port: 587,
        secure: false, // true for 465, false for other ports
        auth: {
          user: process.env.EMAIL_APP, // generated ethereal user
          pass: process.env.EMAIL_APP_PASSWORD, // generated ethereal password
        },
      });
    
      // send mail with defined transport object
      let info = await transporter.sendMail({
        from: '"ScheduleMedicalExamination', // sender address
        to: dataSend.reciverEmail , // list of receivers
        subject: "Thng tin t lch khm bnh", // Subject line
        text: "Hello world?", // plain text body
        html:  `
        <h3>Xin Cho ${dataSend.patientName}!</h3>
        <p>Bn nhn c email ny v bn  t lch khm bnh online trn ScheduleMedicalExamination</p>
        <p>Thng tin t lch khm bnh: </p>
        <div>
            <b>Thi gian: ${dataSend.time}</b>
        </div>
        <div>
             <b>Bc s: ${dataSend.doctorName}</b>
        </div>
  
        <p>
        Nu cc thng tin trn l ng s tht, vui lng Click vo ng link 
         xc nhn v hon tt th tc t lch khm bnh.
        </p>
        <div>
        <a href=${dataSend.redirectLink} target ="_blank" >Click here</a>
        </div>
        
        <div>Xin chn thnh cm n !</div>
        `
      });
      
}

//  Language
let getBodyHTMLEmail = ( dataSend ) => {
  let result = '';
  if ( dataSend.language === 'vi'){
      result = `
      <h3>Xin Cho ${dataSend.patientName}!</h3>
      <p>Bn nhn c email ny v bn  t lch khm bnh online trn ScheduleMedicalExamination</p>
      <p>Thng tin t lch khm bnh: </p>
      <div>
          <b>Thi gian: ${dataSend.time}</b>
      </div>
      <div>
           <b>Bc s: ${dataSend.doctorName}</b>
      </div>

      <p>
      Nu cc thng tin trn l ng s tht, vui lng Click vo ng link 
       xc nhn v hon tt th tc t lch khm bnh.
      </p>
      <div>
      <a href=${dataSend.redirectLink} target ="_blank" >Click here</a>
      </div>
      
      <div>Xin chn thnh cm n !</div>
      `;

  }
  if ( dataSend.language === 'en'){

      result = `
       <h3>Hello ${dataSend.patientName}!</h3>
       <p>You received this email because you booked an online appointment on ScheduleMedicalExamination</p>
       <p>Medical appointment booking information: </p>
       <div>
           <b>Time: ${dataSend.time}</b>
       </div>
       <div>
            <b>Doctor: ${dataSend.doctorName}</b>
       </div>

       <p>
       If the above information is true, please click on the link
       to confirm and complete the procedure to book an appointment.
       </p>
       <div>
       <a href=${dataSend.redirectLink} target ="_blank" >Click here</a>
       </div>
      
       <div>Thank you very much!</div>
       `;
  }
  return result;
}


let getBodyHTMLEmailRemedy = (dataSend) => {
  let result = '';
  if ( dataSend.language === 'vi'){
      result = `
      <h3>Xin Cho ${dataSend.patientName} !</h3>
      <p>Bn nhn c email ny v bn  t lch khm bnh online trn ScheduleMedicalExamination thnh cng</p>
      <p>Thng tin n thuc / ha n c gi trong file nh km </p>
   
      <div>Xin chn thnh cm n !</div>
      `;

  }
  if ( dataSend.language === 'en'){

      result = `
       <h3>Hello ${dataSend.patientName} !</h3>
       <p>You received this email because you booked an online appointment on ScheduleMedicalExamination</p>
       <p>Medical appointment booking information: </p>
       
      
       <div>Thank you very much!</div>
       `;
  }
  return result;
}

// Gui hoa don
let sendAttachment = async (dataSend) => {
    // create reusable transporter object using the default SMTP transport
    let transporter = nodemailer.createTransport({
      host: "smtp.gmail.com",
      port: 587,
      secure: false, // true for 465, false for other ports
      auth: {
        user: process.env.EMAIL_APP, // generated ethereal user
        pass: process.env.EMAIL_APP_PASSWORD, // generated ethereal password
      },
    });
  
    // send mail with defined transport object
    let info = await transporter.sendMail({
      from: '"ScheduleMedicalExamination', // sender address
      to: dataSend.email , // list of receivers
      subject: "Kt qu t lch khm bnh", // Subject line
      text: "Hello world?", // plain text body
      html:  getBodyHTMLEmailRemedy (dataSend),
      attachments:[
        {
          filename: `remedy-${dataSend.patientId}-${new Date ().getTime ()}.png`,
          content: dataSend.imgBase64.split("base64,")[1],
          encoding: 'base64'
        }
      ],
    });
}



module.exports = {
    sendSimpleEmail: sendSimpleEmail,
    sendAttachment: sendAttachment,
    getBodyHTMLEmailRemedy: getBodyHTMLEmailRemedy
}

